import React, { Component } from 'react';
import axios from 'axios';

class Comments extends Component {
  constructor() {
    super();

    this.state = {
      comment: []
    };
  }

  componentDidMount() {
    axios
      .get('https://jsonplaceholder.typicode.com/posts/1/comments')
      .then(res => {
        console.log(res.data);
      });
  }

  render() {
    return <div></div>;
  }
}

export default Comments;
